import styled from "styled-components";

export const HeaderContainer = styled.header`

    display: flex;
    justify-content: space-between;
    align-items: center;
    gap: 10%;
    width: 100vw;

    .imgLogo {
        width: 150px;
        height: 180px;
    }



`
